import React,{Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{

  constructor(props){
    super(props);

  }
  render(){
    const sercador=['http://www.google.com',
    'http://www.bing.com',
    'http://www.yahoo.com'];

    return(
      <div>
        {this.showTitle("sercadors")}
        <ul>
        <li><a className="red" href={sercador[0]}>Google</a></li>
           <li><a className="green" href={sercador[1]}>Bing</a></li>
           <li><a className="blue" href={sercador[2]}>Yahoo</a></li>
        </ul>
      </div>
    );
  }

  calculate(e){
    e.preventDefault();
  }
}

export default App;
